import React from "react";
// import EmojiPedia from "../emojipedia";
import Entry from "./Entry";

function createEntry(EmojiPedia)
{
    return(
    <Entry 
        key={EmojiPedia.id}
        name={EmojiPedia.name}
        meaning={EmojiPedia.meaning}
    />
    );

}

export default createEntry;
